import React, { Component } from 'react';
import InfoContent from './Info/Content';
import ProjectsContent from './Projects/Content';
import ContactContent from './Contact/Content';

export default class TopContentWindows extends Component {
  contentStyles = open => {
    return({
      border: '2px solid red',
      height: '50%',
      position: 'absolute',
      top: open ? '0' : '15%'
    })
  }

  render() {
    const { infoWindow, projectsWindow, contactWindow } = this.props.data
    return (
      <>
        <div style = { this.contentStyles(infoWindow) }>
          <InfoContent />
        </div>
        <div style = { this.contentStyles(projectsWindow) }>
          <ProjectsContent />
        </div>
        <div style = { this.contentStyles(contactWindow) }>
          <ContactContent />
        </div>
      </>
    )
  }
}
